DateTime start = DateTime.Now;
string dsb = "";
List<char> marker = new List<char>() ;

for (int i = 0; i < dsb.Length; i++)
{
    if(marker.Count > 13)
    {
        marker.RemoveAt(0);
    }
    marker.Add(dsb[i]);
    if(marker.Count > 13 && marker.Distinct().Count() == marker.Count)
    {
        Console.WriteLine("The first message marker was found after {0} characters", i + 1);
    }
}

DateTime end = DateTime.Now;
TimeSpan Ts = (end - start);

Console.WriteLine("\nThe program took {0}ms to excecute", Ts.Milliseconds);
